    "Miniaturized, Multi-Analyte Sensor Array for the Automated Monitoring of Major
    Atmospheric Constituents in Spacecraft Environment Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T00:55:40.075529",nt"name": "miniaturized-multi-analyte-sensor-array-for-the-automated-monitoring-of-major-atmospheric--22823",nt"isopen":
    true,nt"url": null,nt"notes": "The objective of the Phase II SBIR project
    is to develop a prototype sensor system to detect gaseous analytes in support of
    the spacecraft environmental monitoring and control system. InnoSense LLC (ISL)
    has utilized its Chemical Fingerprint?' sensor array fabrication technology in Phase
    I to establish the feasibility of a miniature device with multi-analyte detection
    capability.  In particular, we have detected oxygen, carbon dioxide and humidity
    as potential target analytes. The oxygen sensor performed over 3-45&#37; concentrations
    under a variable pressure of 8-14.7 psia. The Phase I working model could generated
    discernible signal with 0.1&#37; O2 concentration. Upon fine-tuning the indicators
    in Phase II, the system performance will be tested with a prototype hardware that
    will also be developed in Phase II.  ISL has received technology endorsement letter
    from a prime contractor in the NASA application area.  ISL has also secured Phase
    III follow-on funding commitment from a commercialization partner. For assuring
    success of this project, ISL has assembled a technical team with a cumulative 100
    person-years of experience in developing commercially viable sensor systems.  ",nt"license_title":
